import Searching from './components/Searching';

function App() {
  return (    
    <Routes>
      <div className="App">
        <div className="container">
        <Route exact path='/about' element={< About />}></Route>       
        <Route exact path='/' element={< Home />}></Route>    
        <Route exact path='/searching' element={< Searching />}></Route>  
        </div>
      </div>
    </Routes>


  );
}

export default App;
